import React from "react";
import { Link } from "react-router-dom";


const Navigation=()=>{

    return (

        <div>
            <Link to="/">Home</Link>
            <Link to="/searchbar">SearchBar</Link>
            <Link to = "/input">Input</Link>
        </div>
    );
}
export default Navigation;
